import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<BookTable/>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
